import React from "react";
import TaskInput from "./components/taskInput/taskInput";
import Footer from "./components/footer/footer";
import { MuiPickersUtilsProvider } from '@material-ui/pickers';
import MomentUtils from '@date-io/moment';
// import DateFnsUtils from '@date-io/date-fns';
// import LuxonUtils from '@date-io/luxon';
import "./App.css";


function App() {
  return (
    <MuiPickersUtilsProvider utils={MomentUtils}>
      <div className="App"> 


        <div className="wrapper">
            <ul className="to-do__menu">
                        <li className="to-do__menu-item">
                            <img
                                className="to-do__menu-img"
                                src="/img/pencil.svg"
                                alt="check"
                                width={18}
                                height={18}
                            />
                            <button className="to-do__menu-img">click!</button>
                            <ul className="to-do__sub-menu">
                                <li className="to-do__menu-list">
                                    <button className="to-do__menu-btn">add</button>
                                </li>
                                <li className="to-do__menu-list">
                                    <button className="to-do__menu-btn">watch</button>
                                </li>
                                <li className="to-do__menu-list">
                                    <button className="to-do__menu-btn">chang</button>
                                </li>
                            </ul>
                        </li> 
                    </ul>
          <div className="to-do">
            <h1 className="to-do__title">todos</h1>     
            <div className="to-do__block">
              <TaskInput/>
              <Footer/>
            </div>
          </div>   
        </div>
      </div> 
    </MuiPickersUtilsProvider>
  )
}


export default App;
